import React from 'react';
import { List, Grid, Segment, Container, Header, Icon,Image,  Button, Divider } from 'semantic-ui-react'
import indra from '../Static/Images/indra.jpg'

const Footer = () => {

    return (
        <React.Fragment>
            <br/>
            <Divider />
            <Segment placeholder style={{ backgroundColor: 'transparent' }}>
                <Segment.Inline>
                    <Image src={indra} avatar size='2em'/>
                </Segment.Inline>
            </Segment>
        </React.Fragment>
    )
}

export default Footer;
